import React from "react";
import projectImage1 from "../assets/project1.jpg";
import projectImage2 from "../assets/project2.jpg";
import projectImage3 from "../assets/project3.jpg";
import projectImage4 from "../assets/project4.jpg";
import projectImage5 from "../assets/project5.jpg";
import projectImage6 from "../assets/project6.jpg";

const Projects = () => {
  const projects = [
    {
      id: 1,
      name: "Project One",
      description: "A brief description of your project goes here.",
      image: projectImage1,
    },
    {
      id: 2,
      name: "Project Two",
      description: "Another exciting project description goes here.",
      image: projectImage2,
    },
    {
      id: 3,
      name: "Project Three",
      description: "Describe what makes this project unique.",
      image: projectImage3,
    },
    {
      id: 4,
      name: "Project Four",
      description: "Showcase your work with an engaging description.",
      image: projectImage4,
    },
    {
      id: 5,
      name: "Project Five",
      description: "Another project to display your skills.",
      image: projectImage5,
    },
    {
      id: 6,
      name: "Project Six",
      description: "Brief but impactful summary of the project.",
      image: projectImage6,
    },
  ];

  return (
    <section id="projects" className="bg-black text-white py-16">
      <div className="container mx-auto">
        <h2 className="text-3xl font-bold mb-8">My Projects</h2>
        <div className="grid grid-cols-1 md:grid-cols-2 lg:grid-cols-3 gap-8">
          {projects.map((project) => (
            <div
              key={project.id}
              className="bg-gray-800 p-4 rounded-md shadow-md hover:shadow-lg transition-shadow duration-300"
            >
              <img
                src={project.image}
                alt={project.name}
                className="w-full h-40 object-cover rounded-t-md"
              />
              <div className="p-4">
                <h3 className="text-xl font-semibold">{project.name}</h3>
                <p className="mt-2 text-gray-300">{project.description}</p>
              </div>
            </div>
          ))}
        </div>
      </div>
    </section>
  );
};

export default Projects;
